$_MODULE['<{add_faktura}prestashop>admin_main_2e0e127ee2f517839afcbc1c4651a2e1'] = 'rozmnožovat, vytvářet kopie zakoupených produktů.';
$_MODULE['<{add_faktura}prestashop>admin_main_4f91db3feda8b180c5783b158457051a'] = '8. Dodavatel nezodpovídá za funkčnost nebo kompatibilitu bezplatně nabízených modulů a odpovědnost za jejich používání. Jakékoliv vzniklé škody či případnou ztrátu a poškození dat, nese výhradně Kupující. K bezplatně nabízeným modulům Dodavatel nezajišťuje žádné bezplatné poradenství ani individuální modifikace. Bezplatné moduly Kupující může:';
$_MODULE['<{add_faktura}prestashop>admin_main_ef5213ddd7fae83a592ca8ca8c46bb1c'] = 'používat jakkoliv a kdekoliv';
$_MODULE['<{add_faktura}prestashop>admin_main_037b91bd391f2263614f82939c41bc74'] = 'provádět modifikace funkčnosti a vzhledu';
$_MODULE['<{add_faktura}prestashop>admin_main_f24961facebd64dd0f3df3e8a4847963'] = 'nabízet je třetím stranám';
$_MODULE['<{add_faktura}prestashop>admin_main_9b06af6e0f1d4d240f4ab9df7f037f41'] = '9. Kupující není oprávněn prodávat třetím stranám jakékoliv Dodavatelem zpoplatněné služby, moduly nebo webové stránky. Zaplacením služeb, produktů a web stránky přecházejí majetková práva z Dodavatele na Kupujícího. Dodavatel si vyhrazuje autorské právo na zhotovené grafické a programátorské práce, jakož i na jednotlivé designy, moduly a úpravy.';
$_MODULE['<{add_faktura}prestashop>admin_main_9dd19f5a41f1332c02c5516d0f5b02ba'] = '10. Kupující bere na vědomí, že nabízené zpoplatněné produkty jsou chráněny autorským zákonem, zabezpečeny proti kopírování a šíření, a zavazuje se, že produkty nebude rozmnožovat, kopírovat, nezneužije je a nebude je poskytovat dál, šířit ani realizovat takové kroky, které by měly za cíl narušit ochranu poskytovaných produktů. Kupující je zodpovědný za škodu, která takovýmto jeho chováním může vzniknout.';
$_MODULE['<{add_faktura}prestashop>admin_main_5730aca3456a19cc3e89ce9ee0af6c35'] = '11. Kupující se zavazuje, že se nebude snažit prolomit ochranu autorských práv a další předpisy, kterými se řídí ochrana duševního vlastnictví.';
$_MODULE['<{add_faktura}prestashop>admin_main_cb64f400d09c10f488149452b4d10ad2'] = '12. Download software je povolen pouze z presta-modul.shopmk.cz nebo ze souboru zaslaného Dodavatelem na e-mailovou adresu Kupujícího. Používáním tohoto softwaru znamená, že Kupující souhlasí s výše uvedenými autorskými právy.';
$_MODULE['<{add_faktura}prestashop>admin_main_3e686ff1c164a515748964106487e83b'] = '13. Kupující prohlašuje, že Dodavatel nenese právní zodpovědnost za škody způsobené v souladu s užíváním vůči objednateli ani třetím stranám, a že jakékoliv vzniklé škody či případnou ztrátu a poškození dat nesprávným nastavením, užíváním produktu či případnými úpravami produktu Kupujícím, nese výhradně Kupující.';
$_MODULE['<{add_faktura}prestashop>admin_main_5c5d045b131891b94a5fbb40070ca446'] = 'PRODEJ A DISTRIBUCE JE ZAKÁZÁNA!';
$_MODULE['<{add_faktura}prestashop>admin_main_5dd5f10920a7fe8d601e08560c674464'] = ' Download software je povolen pouze z ';
$_MODULE['<{add_faktura}prestashop>admin_main_e71406c944afa8ef351714f3e05eeea8'] = 'nebo ze souboru zaslaného Dodavatelem na e-mailovou adresu Kupujícího. ';
$_MODULE['<{add_faktura}prestashop>admin_main_9ccdc101a3218c2858dd5381ba138875'] = 'Používáním tohoto softwaru znamená, že Kupující souhlasí s výše uvedenými autorskými právy.';
$_MODULE['<{add_faktura}prestashop>admin_main_14ec67bd416bcbe3a2ad93246dcc05cb'] = 'Kupující prohlašuje, že Dodavatel nenese právní zodpovědnost za škody ';
$_MODULE['<{add_faktura}prestashop>admin_main_a928b7a9dc8233d58ebacf44eaeb9cda'] = 'způsobené v souladu s užíváním vůči objednateli ani třetím stranám, ';
$_MODULE['<{add_faktura}prestashop>admin_main_42a1157b447865a77b786ea3e1e5d31f'] = 'a že jakékoliv vzniklé škody či případnou ztrátu a poškození dat nesprávným nastavením,';
$_MODULE['<{add_faktura}prestashop>admin_main_927a0d6a3af7d4d91dd6b01ab3f4ae8d'] = 'užíváním produktu či případnými úpravami produktu Kupujícím,';
$_MODULE['<{add_faktura}prestashop>admin_main_7d16d80b8fd3be9ab64091e0d57dd735'] = 'nese výhradně Kupující.';
